import { Routes, Route } from 'react-router-dom';
import BirthdayPage from './BirthdayPage';
import GamesPage from './GamesPage';

function App() {
  return (
    <Routes>
      <Route path="/" element={<BirthdayPage />} />
      <Route path="/games" element={<GamesPage />} />
      {/* other routes */}
    </Routes>
  );
}

export default App;
